import './App.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { useState, useEffect } from 'react';

// User Components
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Banner from "./components/Banner";
import Home from "./components/Home";
import About from "./components/About";
import Chat from "./components/Chat";
import Help from "./components/Help";

// Admin Components
import AdminSidebar from "./components/AdminSideBar";
import AdminFooter from "./components/AdminFooter";
import AHome from "./Admin/Home";
import Categories from "./Admin/Category";
import Chatbot from "./Admin/Chat";
import Model from "./Admin/Model";
import LoginRegister from "./Admin/LoginRegister";

// Protected Route Component
const ProtectedRoute = ({ children, isAdmin, requireAdmin }) => {
  if (requireAdmin && !isAdmin) {
    return <Navigate to="/" replace />;
  }
  return children;
};

// Layout Components
const UserLayout = ({ children }) => (
  <div className='flex flex-col gap-0'>
    <Navbar />
    {children}
    <Footer />
  </div>
);

const AdminLayout = ({ children }) => (
  <div className='flex h-screen'>
    <AdminSidebar />
    <div className='flex-1 flex flex-col'>
      <div className='flex-1 overflow-auto'>
        {children}
      </div>
      <AdminFooter />
    </div>
  </div>
);

function App() {
  // Simulate user role - Replace this with actual authentication logic
  const [userRole, setUserRole] = useState('admin'); // 'user' or 'admin'

  // You can get this from localStorage, context, or your auth service
  useEffect(() => {
    const storedRole = localStorage.getItem('userRole');
    if (storedRole) {
      setUserRole(storedRole);
    }
  }, []);

  const isAdmin = userRole === 'admin';

  return (
    <Router>
      <Routes>
        {/* User Routes */}
        <Route path="/" element={
          <UserLayout>
            <Banner />
          </UserLayout>
        } />
        <Route path="/scan" element={
          <UserLayout>
            <Home />
          </UserLayout>
        } />
        <Route path="/about" element={
          <UserLayout>
            <About />
          </UserLayout>
        } />
        <Route path="/chat" element={
          <UserLayout>
            <Chat />
          </UserLayout>
        } />
        <Route path="/help" element={
          <UserLayout>
            <Help />
          </UserLayout>
        } />

        {/* Admin Routes - Protected */}
        <Route path="/admin" element={
          <ProtectedRoute isAdmin={isAdmin} requireAdmin={true}>
            <AdminLayout>
              <AHome />
            </AdminLayout>
          </ProtectedRoute>
        } />
        <Route path="/admin/categories" element={
          <ProtectedRoute isAdmin={isAdmin} requireAdmin={true}>
            <AdminLayout>
              <Categories />
            </AdminLayout>
          </ProtectedRoute>
        } />
        <Route path="/admin/chatbot" element={
          <ProtectedRoute isAdmin={isAdmin} requireAdmin={true}>
            <AdminLayout>
              <Chatbot />
            </AdminLayout>
          </ProtectedRoute>
        } />
        <Route path="/admin/model" element={
          <ProtectedRoute isAdmin={isAdmin} requireAdmin={true}>
            <AdminLayout>
              <Model />
            </AdminLayout>
          </ProtectedRoute>
        } />

        {/* Admin Login - No Layout */}
        <Route path="/admin/login" element={<LoginRegister />} />

        {/* Catch all - redirect to home */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
